import React, { useState } from "react";
import SResult from './SResult';

const Search = () => {
  const [img, setImg] = useState("");

  const inputEvent = (event) => {
      const data = event.target.value;
      setImg(data);
      
  };


  return (
    <>
      <section>
        <input
          type="text"
          placeholder="Search"
          value={img}
          onChange={inputEvent}
        />
        <SResult name={img} />
      </section>
    </>
  );
};

export default Search;
